;; **
;;; # Graph traversal
;;; 
;;; After playing a bit with **loom**, we start considering how to traverse a graph with it.
;;; 
;;; ## Euler tour
;;; 
;;; Considering the now infamous **7 bridges** problem, we know that Euler observed that it is impossible to cross all the bridges only once. The problem can be considered as a **graph**: one enters a vertex by one edge and leaves the vertex by a different edge. If every edge has been traversed exactly once, it follows that the number of connecting edges for each node must be even.
;;; 
;;; To check if an Euler tour is possible in a graph, all the nodes must have an even number of connecting edges.
;; **

;; @@
(defn euler-tour?
  [graph]
  (let [degree (partial loom/out-degree graph)]
    (->> (loom/nodes graph)
         (filter (comp odd? degree))
         (count)
         (contains? #{0 2}))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;ch8.ws/euler-tour?</span>","value":"#'ch8.ws/euler-tour?"}
;; <=

;; **
;;; ## Breadth-first
;;; 
;;; **Breadth-first** search starts with a vertex and then searches each of its neighbors for the target vertex. If it doesn't find the target, starts repeating the same procedure for the neighbor's neighbors until it finds the target or the entire graph has been traversed.
;; **

;; @@
(let [graph (->> (load-edges "twitter/98801140.edges")
                 (apply loom/digraph))]
  (alg/bf-traverse graph 100742942))
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-list'>(</span>","close":"<span class='clj-list'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-long'>100742942</span>","value":"100742942"},{"type":"html","content":"<span class='clj-long'>35432131</span>","value":"35432131"},{"type":"html","content":"<span class='clj-long'>27475761</span>","value":"27475761"},{"type":"html","content":"<span class='clj-long'>3829151</span>","value":"3829151"}],"value":"(100742942 35432131 27475761 3829151)"}
;; <=

;; **
;;; ## Depth-first
;;; 
;;; **Depth-first** search proceeds immediately to the bottom of a tree (it resolves a full branch) and then goes on until it finds a target or the graph has been traversed.
;; **

;; @@
(let [graph (->> (load-edges "twitter/98801140.edges")
                 (apply loom/digraph))]
  (alg/pre-traverse graph 100742942))
