;; **
;;; ## Minimum spanning trees
;;; 
;;; Ok, we found the shortest path, but if we want to find a route connecting all the nodes in the graph? The **Minimum spanning tree** is a hybrid between the full graph traversal and the shortest path algo.
;; **

;; @@
(let [graph (->> (load-edges "twitter/396721965.edges")
                 (apply loom/weighted-graph))]
  (-> (alg/prim-mst graph)
      (loom-view)))
;; @@
;; =>
