;; **
;;; A directed graph is **strongly connected** if there is a path from every node to every other node. It is **weakly connected** if by treating all the edges as being undirected there is a path from every node to every other node.
;;; 
;;; In the graph above it is tough to see how many strongly connected components are present, we can use **Kosaraju**'s algo to calculate the number of strongly connected components
;; **

;; @@
(->> (load-edges "twitter/15053535.edges")
     (apply loom/digraph)
     (alg/scc)
     (count))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>13</span>","value":"13"}
;; <=

;; **
;;; The response we get contains all strongly connected components as vectors. To check the largest one we can do something like this
;; **

;; @@
(->> (load-edges "twitter/15053535.edges")
     (apply loom/digraph)
     (alg/scc)
     (sort-by count >)
     (first))
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-vector'>[</span>","close":"<span class='clj-vector'>]</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-long'>14927205</span>","value":"14927205"},{"type":"html","content":"<span class='clj-long'>14596164</span>","value":"14596164"},{"type":"html","content":"<span class='clj-long'>14838506</span>","value":"14838506"}],"value":"[14927205 14596164 14838506]"}
