;; **
;;; # Whole-graph analysis
;;; 
;;; Let's focus on the larger graphs of Twitter connections. The first metric we're interested in is **density**: it is the number of edges @@|E|@@ over the number of vertices @@|V|@@ multiplied by one less than itself:
;;; 
;;; $$D=\frac{|E|}{|V|(|V|-1)}$$
;;; 
;;; For a connected graph the density would be 1, while for a disconnected one it would be 0.
;; **

;; @@
(->> (load-edges "twitter_combined.txt")
     (apply loom/digraph)
     (alg/density)
     (double))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-double'>2.674724217609368E-4</span>","value":"2.674724217609368E-4"}
;; <=

;; **
;;; It is clear that the graph is very sparse, but this is what we would expect in a large social network.
;;; 
;;; Now let's see how the edges are distributed among nodes.
;; **

;; @@
(let [graph (->> (load-edges "twitter_combined.txt")
                 (apply loom/digraph))
      out-degrees (map #(loom/out-degree graph %)
                       (loom/nodes graph))]
  (plot/histogram out-degrees :bins 50 :plot-size 600))
