;; **
;;; We notice that the distribution **out-degrees** and **in-degrees** resembles an exponential distribution, we can likely say that there is some process generating these networks. For better comparison we can generate 10,000 random nodes and 1,000,000 edges
;; **

;; @@
(let [graph (generate/gen-rand (loom/graph) 10000 1000000)
      out-degrees (map #(loom/out-degree graph %)
                       (loom/nodes graph))]
  (plot/histogram out-degrees :bins 50 :plot-size 600))
